import React from 'react';
import './ConvertPanel.css';

function ConvertPanel() {
    return (
        <div className="container">
            <div className="convertPanelBox">
                <div className="convertPanelBox-letter">
                    <a>Prueba</a>
                </div>
            </div>
        </div>
    );
}

export default ConvertPanel;
